public static <E extends CoreAttrs> E setSelector(E e, String selector) {
  String[] res = parseSelector(selector);
  if (res[S_ID] != null) {
    e.$id(res[S_ID]);
  }
  if (res[S_CLASS] != null) {
    e.$class(res[S_CLASS]);
  }
  return e;
}
